> Top News Billionaire Trump attracts enthusiasm of small-dollar donors In this Oct. 14, 2015, photo, Republican presidential hopeful Donald Trump gestures during a speech to supporters at a rally in Richmond, Va. Trump has long boasted about his enormous wealth and how he doesn’t need anyone else’s money to fund his presidential campaign. But that hasn’t stopped tens of thousands of people from across the country from chipping in with small-dollar checks as small as $10 or $25 to let him know that they’re behind him. (AP Photo/Steve Helber) 
